        <div>
            <div className="main">
                <p className="home-headline">Verkaufstelle er√∂ffnen </p>
                 <StationForm
                    onNewStation={station =>
                    setStations(currentStations => [station, ...currentStations])
                     }
                  />
            </div>
        </div>
        
     );

}
 
